(17, 'جنين', 'محافظة جنين محافظة تقع في شمال الضفة الغربية التابعة للسلطة الفلسطينية ومركزها مدينة جنين.', 1101, 'ar', 'map.geojson', '32.4572845', '35.2847044', 10, '2018-05-09 12:07:25', '2019-02-18 11:59:39', NULL, NULL, 1101),
(18, 'طوباس', 'محافظة طوباس ويُطلق عليها أيضًا محافظة طوباس والأغوار الشمالية هي محافظة فلسطينية، مركزها مدينة طوباس.', 0, 'ar', 'tubas.geojson', '35.36773681640625', '32.319633552035214', 10, '2018-05-09 12:14:45', '2018-05-09 12:14:45', NULL, NULL, 1105),
(19, 'طولكرم', 'حافظة طولكرم هي محافظة فلسطينية تابعة للسلطة الوطنية الفلسطينية وتقع في الضفة الغربية وتحديداً في شمال غرب الضفة الغربية. ', 0, 'ar', 'map.geojson', '35.02763271331787', '32.311581955172265', 10, '2018-05-09 12:19:18', '2018-05-09 12:19:18', NULL, NULL, 1110),
(20, 'نابلس', 'محافظة نابلس إحدى محافظات السلطة الوطنية الفلسطينية و تقع في شمال الضفة الغربية و تبعد 53 كم عن القدس. مركزها مدينة نابلس.', 1115, 'ar', 'nablus.geojson', '32.2243446', '35.2301697', 10, '2018-05-09 12:22:30', '2019-02-18 12:01:38', NULL, NULL, 1115),
(21, 'قلقيلية', 'محافظة قلقيلية وهي واحدة من المحافظات التابعة للسلطة الوطنية الفلسطينية في الضفة الغربية شمال غرب البلاد. وتقع على الحدود مع الخط الأخضر.', 0, 'ar', NULL, '', '', 10, '2018-05-09 17:02:00', '2018-05-09 17:02:00', NULL, NULL, 1120),
(22, 'سلفيت', 'محافظة سلفيت واحدة من المحافظات الستة عشر التابعة للسلطة الوطنية الفلسطينية، مركزها مدينة سلفيت', 0, 'ar', NULL, '32.0851114', '35.1720772', 10, '2018-05-09 17:02:32', '2018-11-28 14:49:07', NULL, NULL, 1125),
(23, 'رام الله والبيرة', 'محافظة رام الله والبيرة تقسيم إداري بني على أساس أن المدينتين الشقيقتين متلاصقتين لدرجة أنهما تبدوان كمدينة واحدة. ', 0, 'ar', NULL, '31.9073861', '35.1883724', 10, '2018-05-09 17:03:09', '2018-11-28 14:54:24', NULL, NULL, 1230),
(24, 'أريحا', 'محافظة أريحا هي واحدة من 16 محافظات تابعة للسلطة الوطنية الفلسطينية داخل الأراضي الفلسطينية', 0, 'ar', NULL, '31.8595075', '35.4469982', 10, '2018-05-09 17:03:48', '2018-11-28 14:52:47', NULL, NULL, 1235),
