(26, 'بيت لحم', 'محافظة بيت لحم هي واحدة من 16 محافظة في الضفة الغربية وقطاع غزة داخل الأراضي الفلسطينية.', 0, 'ar', NULL, '31.7053996', '35.1936877', 10, '2018-05-09 17:06:38', '2018-11-28 14:58:14', NULL, NULL, 1345),
(27, 'الخليل', 'محافظة الخليل هي محافظة فلسطينية واقعة في جنوب الضفة الغربية وتبلغ مساحتها 997 كم² ', 0, 'ar', NULL, '31.5325865', '35.0910712', 10, '2018-05-09 17:06:58', '2018-11-28 14:59:36', NULL, NULL, 1350),
(28, 'شمال غزة', 'محافظة شمال غزة هي أحد المحافظات في قطاع غزة. تولت السلطة الفلسطينية إدارة المحافظة تطبيقا لاتفاق أوسلو سنة 1993 بعد أن كانت تتخذها قوات الجيش الإسرائيلي مقرا لها أثناء احتلال قطاع غزة ما بين 1967 و1994.', 0, 'ar', NULL, '31.5513065', '34.5004672', 10, '2018-05-09 17:08:26', '2018-11-28 17:21:23', NULL, NULL, 2455),
(29, 'غزة', 'محافظة غزة هي واحدة من 16 محافظة من محافظات السلطة الوطنية الفلسطينية تقع في شمال قطاع غزة الذي تديره السلطة الوطنية الفلسطينية.', 0, 'ar', NULL, '31.5017126', '34.4580897', 10, '2018-05-09 17:08:57', '2018-11-28 16:04:26', NULL, NULL, 2413),
(30, 'خان يونس', 'خان يونس هي مدينة فلسطينية، ومركز محافظة خان يونس. تقع في الجزء الجنوبي من قطاع غزة، وتبعد عن القدس مسافة 100 كم إلى الجنوب الغربي.', 0, 'ar', NULL, '31.3462181', '34.2952438', 10, '2018-05-09 17:09:49', '2018-11-28 15:01:07', NULL, NULL, 2470),
