(15, 'Population', '', '', '<p>Who lives in Palestine, and how is the population changing over time? These datasets depict the total population for the West Bank and Gaza, disaggregated by region and sex. It also includes key data household size, marriage and divorce rates, and registered births and deaths yearly.&nbsp;</p>', 'en', 1, 0, 0, 'topics', 'Population.svg', 0, '2018-04-15 07:52:17', '2019-03-27 21:21:24', NULL, NULL, NULL),
(16, 'Education', '', '', '<p>Where do Palestinians study, and how does education shape their futures? Look no further to find statistics on all stages of education, including enrollment by school type and education success rates. You can also view statistics on university enrollment and employment at universities. <br></p>', 'en', 1, 0, 0, 'topics', 'education.svg', 0, '2018-04-15 09:02:51', '2019-04-10 10:04:43', NULL, NULL, 66),
