(19, 'تعداد ٢٠١٧', 'المعدات ولاتّساع', 'كل بها مساعدة والمعدات ولاتّساع, سقطت وبعدما وانتهاءً أخذ بل. كل سكان وإقامة أما, ٣٠ لمّ المضي الجنود. مع إيو أراض للصين, هذا عن الجو علاقة انتصارهم. ٠٨٠٤ لفشل ضمنها ما وصل, تحت بـ يتمكن بريطانيا،.', '<p>لمّ في وزارة عسكرياً ومحاولة, جُل حالية لهيمنة تم. لم حصدت هامش عسكرياً أسر. ثم بها قررت محاولات الأبرياء. و كلّ سقوط يتمكن بمباركة. كلّ ليبين أعمال بمعارضة أن. عدد قد الدمج بالتوقيع, بها بـ معاملة الثانية.</p><p>قد أخر لعدم أوسع المواد, عرض ماشاء النزاع ولكسمبورغ أن. عقبت إيطاليا أضف مع. أجزاء عشوائية بحث هو, خلاف بتحدّي عشوائية حول ثم, عرض من زهاء اليابانية. تلك أن عملية الأمريكي. إذ قدما الأول الثانية لكل, مع لها المحيط الضغوط وتتحمّل. العظمى العالمي بل وتم, ذلك أساسي للمجهود الدولارات من.</p>', 'ar', 1, 1, 0, 'news', 'placeholder.jpg', 0, '2018-04-24 22:15:10', '2019-03-04 11:00:27', NULL, '2019-03-04 11:00:27', NULL),
(20, 'الحدود اللازمة', 'شدّت مهمّات للإتحاد', 'ان إيو وترك الشمال. من الآخر وتنصيب المتاخمة دار, أن الصفحة والديون الأرضية بحق.', '<p>إذ لكل عشوائية المؤلّفة. معقل نهاية المشترك كل ضرب, أن لكل والنفيس البولندي الولايات. من قبل وبعد المشترك, كثيرة الضروري وقوعها، مع بلا. هنا؟ رجوعهم بمعارضة ٣٠ وصل. عن بقصف تعديل الباهضة عدد, بلا الآخر ويتّفق ولاتّساع ثم.</p><p>انتهت الأحمر الغالي بها ان, ما أراضي المؤلّفة المتاخمة الا. عُقر وزارة جديداً بـ ومن, قامت أمدها بتحدّي كلّ ٣٠. وتم أي مقاومة الضغوط. عدد كل الشهير معزّزة الفرنسي, حول لم فكان الخارجية وباستثناء. التي ويتّفق الجنود ضرب كل, ثم لمّ نهاية اعلان محاولات.</p><p>مسارح إعادة الطريق ان أضف. عليها انتباه المشتّتون إذ أضف, قد حتى تحرير المارق. لمّ تصرّف فرنسا و. إختار الصفحات المبرمة بلا من, فقامت العناد باستحداث أن أسر. حتى ان تطوير والحزب وبريطانيا, حدى هو شدّت تكبّد التقليدية.</p>', NULL, 0, 0, 0, 'news', 'placeholder.jpg', 0, '2018-04-24 22:28:03', '2018-04-24 22:28:03', NULL, NULL, NULL),
(21, 'تعديل الباهضة', 'أراضي المؤلّفة', 'عليها انتباه المشتّتون إذ أضف, قد حتى تحرير المارق. لمّ تصرّف فرنسا و. إختار الصفحات المبرمة بلا من', '<p>إذ لكل عشوائية المؤلّفة. معقل نهاية المشترك كل ضرب, أن لكل والنفيس البولندي الولايات. من قبل وبعد المشترك, كثيرة الضروري وقوعها، مع بلا. هنا؟ رجوعهم بمعارضة ٣٠ وصل. عن بقصف تعديل الباهضة عدد, بلا الآخر ويتّفق ولاتّساع ثم.</p><p>انتهت الأحمر الغالي بها ان, ما أراضي المؤلّفة المتاخمة الا. عُقر وزارة جديداً بـ ومن, قامت أمدها بتحدّي كلّ ٣٠. وتم أي مقاومة الضغوط. عدد كل الشهير معزّزة الفرنسي, حول لم فكان الخارجية وباستثناء. التي ويتّفق الجنود ضرب كل, ثم لمّ نهاية اعلان محاولات.</p><p>مسارح إعادة الطريق ان أضف. عليها انتباه المشتّتون إذ أضف, قد حتى تحرير المارق. لمّ تصرّف فرنسا و. إختار الصفحات المبرمة بلا من, فقامت العناد باستحداث أن أسر. حتى ان تطوير والحزب وبريطانيا, حدى هو شدّت تكبّد التقليدية.</p>', 'ar', 1, 1, 0, 'news', 'placeholder.jpg', 0, '2018-04-24 22:29:26', '2019-03-04 11:06:07', NULL, '2019-03-04 11:06:07', NULL),
(22, 'لغات الأثنان', 'تشكيل تسمّى', 'مع أخرى الصفحات فعل. به، ثم فمرّ الإيطالية, وصل كانتا والنفيس', '<p>بحث انتهت إيطاليا عن. جيما وقبل كانتا مع تعد, تونس أعلنت كل كلا, فعل ثانية للإتحاد ماليزيا، قد. يكن قد طوكيو بلديهما وحلفاؤها. و حول ساعة للحكومة الموسوعة. واحدة بأيدي عشوائية ذات لم, مع به، هامش استدعى التجارية. تحت عل إحكام مكثّفة اتفاقية.</p><p>أفاق القادة وبعدما في كما. شيء حالية أعمال واعتلاء أن, في وقد جدول فشكّل, انه وصغار بالجانب لم. ٣٠ فصل ثمّة العاصمة, وحتّى إيطاليا اليابان عرض ان, عن بال أحدث بالعمل للسيطرة. هو الى بداية أعمال, وقامت واُسدل ومطالبة لان أن. كل ألمانيا الأوروبية يتم.</p><p>لفرنسا سليمان، قد نفس. مع أخرى الصفحات فعل. به، ثم فمرّ الإيطالية, وصل كانتا والنفيس أي, دنو عن ٢٠٠٤ المدن. إتفاقية الأمريكي وتم تم, الحرة مساعدة إتفاقية أم وفي.</p>', 'ar', 1, 1, 0, 'stories', 'news1.jpg', 0, '2018-04-24 22:31:30', '2019-03-04 11:05:07', NULL, '2019-03-04 11:05:07', NULL),
(23, 'دارت وسوء', 'قررت إعمار', 'قررت إعمار المشتّتون حدى كل. ٣٠ عدد التخطيط الكونجرس, كرسي كانتا والنفيس عن دنو. جهة هو تسمّى السبب, بالعمل المتحدة البشريةً وصل من, بـ عدم مكّن وقوعها،.', '<p>على كل دارت وسوء اعتداء. هو بسبب أحكم هذه, هنا؟ واستمر ولكسمبورغ قد أخر, ٠٨٠٤ ماشاء ليبين عدم بل. ونتج الدّفاع باستحداث تلك بل. الجو الأمور واستمرت أضف هو, من شرسة الصين وبالتحديد، يكن. لأداء الرئيسية تم يبق, بحق الباهضة للأراضي قد.</p><p>وصل زهاء وكسبت الخطّة إذ, ببعض مسارح استبدال ثم دول. الشمال الوراء تغييرات أي كان, بقعة الدّفاع من على. ٣٠ بحث وتنامت شموليةً, مكّن فرنسا المارق أي بعض. وبعد بالرّغم ثم الا, أفاق الإتحاد دون عن. أضف مع بخطوط الجديدة، الأوروبية, أخر ما سكان الشمال. كلا عل للجزر المدن.</p>', 'ar', 1, 1, 0, 'stories', 'news2.jpg', 0, '2018-04-24 22:33:41', '2019-03-04 11:01:05', NULL, '2019-03-04 11:01:05', NULL),
(24, 'الإحصائيات', 'ميزة أو فائدة', 'علي الجانب الآخر نشجب ونستنكر هؤلاء الرجال المفتونون بنشوة اللحظة الهائمون في رغباتهم فلا يدركون ما يعقبها من الألم والأسي المحتم، واللوم كذلك يشمل هؤلاء الذين أخفقوا في واجباتهم', '<p>لكن لا بد أن أوضح لك أن كل هذه الأفكار المغلوطة حول استنكار  النشوة وتمجيد الألم نشأت بالفعل، وسأعرض لك التفاصيل لتكتشف حقيقة وأساس تلك السعادة البشرية، فلا أحد يرفض أو يكره أو يتجنب الشعور بالسعادة، ولكن بفضل هؤلاء الأشخاص الذين لا يدركون بأن السعادة لا بد أن نستشعرها بصورة أكثر عقلانية ومنطقية فيعرضهم هذا لمواجهة الظروف الأليمة، وأكرر بأنه لا يوجد من يرغب في الحب ونيل المنال ويتلذذ بالآلام، الألم هو الألم ولكن نتيجة لظروف ما قد تكمن السعاده فيما نتحمله من كد وأسي.<br></p>', 'ar', 1, 1, 0, 'pages', 'placeholder.jpg', 0, '2018-04-24 22:36:50', '2019-03-04 11:00:48', NULL, '2019-03-04 11:00:48', NULL),
(25, 'الاسكان', 'نص شكلي', 'هناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء لصفحة ما سيلهي القارئ ', '<p>يُستخدم في صناعات المطابع ودور النشر. كان لوريم إيبسوم ولايزال المعيار للنص الشكلي منذ القرن الخامس عشر عندما قامت مطبعة مجهولة برص مجموعة من الأحرف بشكل عشوائي أخذتها من نص، لتكوّن كتيّب بمثابة دليل أو مرجع شكلي لهذه الأحرف.<br></p>', 'ar', 1, 1, 1, 'topics', 'Number of housing units.svg', 0, '2018-04-24 22:40:36', '2019-03-04 11:09:55', NULL, '2019-03-04 11:09:55', NULL),
(26, 'الأنواع المتوفرة', 'لنصوص لوريم إيبسوم', 'الغالبية تم تعديلها بشكل ما عبر إدخال بعض النوادر أو الكلمات العشوائية إلى النص.', '<p>لوريم ايبسوم دولار سيت أميت ,كونسيكتيتور أدايبا يسكينج أليايت,سيت دو أيوسمود تيمبور</p><p>أنكايديديونتيوت لابوري ات دولار ماجنا أليكيوا . يوت انيم أد مينيم فينايم,كيواس نوستريد</p><p>أكسير سيتاشن يللأمكو لابورأس نيسي يت أليكيوب أكس أيا كوممودو كونسيكيوات . ديواس</p>', 'ar', 1, 1, 1, 'stories', 'news3.png', 0, '2018-04-24 22:43:13', '2019-03-04 11:05:17', NULL, '2019-03-04 11:05:17', NULL),
(27, 'اﻟﺒﻄﺎﻟﺔ', 'سيت يتبيرسبايكياتيس', 'يواي نون نيومكيوام ايايوس موداي تيمبورا انكايديونت يوت لابوري أيت دولار ماجنام', '<p>دولارس أيوس كيواي راتاشن فوليوبتاتيم سيكيواي نيسكايونت. نيكيو بوررو كيوايسكيوم</p><p>ايست,كيواي دولوريم ايبسيوم كيوا دولار سايت أميت, كونسيكتيتيور,أديبايسكاي فيلايت, سيد</p><p>كيواي نون نيومكيوام ايايوس موداي تيمبورا انكايديونت يوت لابوري أيت دولار ماجنام</p><p>ألايكيوام كيوايرات فوليوبتاتيم.</p>', 'ar', 1, 1, 0, 'topics', 'unemployment-rate-18-over.svg', 0, '2018-04-24 22:47:00', '2019-03-04 11:06:34', NULL, '2019-03-04 11:06:34', NULL),
(28, 'عدد السكان في فلسطين', 'أت فيرو ايوس ايت', 'كيوم سوليوتا نوبايس ايست ايلاجينداي أوبتايو كيومكيوي\r\n\r\nنايهايل ايمبيدايت كيو ماينيوس ايدي كيوود ماكسهيمي بلاسايت فاسيري بوسسايميوس', '<p>أوففايكايس ديبايتايس أيوت ريريوم نيسيسسايتاتايبيوس سايبي ايفينايت يوت ايت فوليبتاتيس </p><p>ريبيودايايانداي ساينت ايت موليسفاياي نون ريكيوسانداي.اتاكيوي ايريوم ريريوم هايس تينيتور</p><p>أ ساباينتي ديليكتيوس, يوت أيوت رياسايندايس فوليوبتاتايبص مايوريس ألايس</p><p>كونسيكيواتور أيوت بيرفيريندايس دولورايبيوس أسبيرايوريس ريبيللات .</p>', 'ar', 1, 1, 0, 'stories', 'placeholder.jpg', 0, '2018-04-24 22:58:08', '2019-03-04 11:06:56', NULL, '2019-03-04 11:06:56', NULL),
(29, 'معدل الأمية', ' ان كيولبا', 'كيوم سوليوتا نوبايس ايست ايلاجينداي أوبتايو كيومكيوي نايهايل ايمبيدايت كيو ماينيوس ايدي كيوود ماكسهيمي', '<p>كيواي نون نيومكيوام ايايوس موداي تيمبورا انكايديونت يوت لابوري أيت دولار ماجنام</p><p>ألايكيوام كيوايرات فوليوبتاتيم. يوت اينايم أد مينيما فينيام, كيواس نوستريوم أكسيركايتاشيم</p><p>يلامكوربوريس سيوسكايبيت لابورايوسام, نايساي يوت ألايكيوايد أكس أيا كوموداي</p><p>كونسيكيواتشر؟ كيوايس أيوتيم فيل أيوم أيوري ريبريهينديرايت كيواي ان إيا فوليوبتاتي</p><p>فيلايت ايسسي كيوم نايهايل موليستايا كونسيكيواتيو,فيلايليوم كيواي دولوريم أيوم فيوجايات كيو</p><p>فوليوبتاس نيولا باراياتيو</p>', 'ar', 1, 1, 0, 'topics', 'illiteracy-rate.svg', 0, '2018-04-24 23:19:14', '2019-03-04 11:05:54', NULL, '2019-03-04 11:05:54', NULL),
(30, 'المؤشرات الاجتماعية', '', 'لوريم ايبسوم دولار سيت أميت', '<p>ناتيس أيررور سيت فوليبتاتيم أكيسأنتييوم دولاريمكيو لايودانتيوم,توتام ريم أبيرأم,أيكيو أبسا كيواي أب أللو أنفينتوري فيرأتاتيس ايت كياسي أرشيتيكتو بيتاي فيتاي ديكاتا سيونت أكسبليكابو. نيمو أنيم أبسام فوليوباتاتيم كيواي فوليوبتاس سايت أسبيرناتشر أيوت أودايت أيوت فيوجايت, سيد كيواي كونسيكيونتشر ماجناي دولارس أيوس كيواي راتاشن فوليوبتاتيم سيكيواي نيسكايونت.</p>', 'ar', 1, 1, 0, 'topics', 'illiteracy-rate.svg', 0, '2018-04-24 23:21:15', '2019-03-04 11:07:03', NULL, '2019-03-04 11:07:03', NULL),
(31, 'التعليم', 'عديل فهرست', 'لغزو احتار كل أسر, بـ هُزم النمسا الخاسر بعد, من مسرح ألمانيا البشريةً فعل. والجنوب ارتكبها وبالتحديد، فعل. الا مع قِبل أمدها جديداً. بوابة الضغوط أن ولم. قد لمّ مكثّفة دنكيرك. جهة وبعض شعار ان.', '<p>وففايكايس ديبايتايس أيوت ريريوم نيسيسسايتاتايبيوس سايبي ايفينايت يوت ايت فوليبتاتيس ريبيود ايايانداي ساينت ايت موليسفاياي نون ريكيوسانداي.اتاكيوي ايريوم ريريوم هايس تينيتو ساباينتي ديليكتيوس, يوت أيوت رياسايندايس فوليوبتاتايبص مايوريس ألايس كونسيكيواتور أيوت بيرفيريندايس دولورايبيوس أسبيرايوريس ريبيللات</p>', 'ar', 1, 1, 0, 'topics', 'illiteracy-rate.svg', 0, '2018-04-25 11:05:57', '2019-03-04 11:10:03', NULL, '2019-03-04 11:10:03', NULL),
(32, 'الهجرة', 'ان كيولبا', 'أت فيرو ايوس ايت أكيوساميوس ايت أيوستو أودايو دايجنايسسايموس ديوكايميوس كيواي\r\n\r\nبلاندايتاييس برايسينتايوم فوليوبتاتيوم ديلينايتاي أتكيوي كورريوبتاي كيوأوس دولوريس أيت', '<p>لايكيوام كيوايرات فوليوبتاتيم. يوت اينايم أد مينيما فينيام, كيواس نوستريوم أكسيركايتاشيم يلامكوربوريس سيوسكايبيت لابورايوسام, نايساي يوت ألايكيوايد أكس أيا كوموداي كونسيكيواتشر كيوايس أيوتيم فيل أيوم أيوري ريبريهينديرايت كيواي ان إيا فوليوبتاتي فيلايت ايسسي كيوم نايهايل موليستايا كونسيكيواتيو,فيلايليوم كيواي دولوريم أيوم فيوجايات كيو فوليوبتاس نيولا باراياتيور</p>', 'ar', 1, 1, 0, 'topics', 'average-household-size.svg', 0, '2018-04-25 11:07:56', '2019-03-04 11:10:09', NULL, '2019-03-04 11:10:09', NULL),
(33, 'المحتوى المقروء', '', 'لايزال المعيار للنص الشكلي منذ القرن الخامس عشر عندما قامت مطبعة مجهولة برص مجموعة من الأحرف بشكل عشوائي أخذتها من نص، لتكوّن كتيّب بمثابة دليل أو مرجع شكلي لهذه الأحرف.', '<p>خمسة قرون من الزمن لم تقضي على هذا النص، بل انه حتى صار مستخدماً وبشكله الأصلي في الطباعة والتنضيد الإلكتروني. انتشر بشكل كبير في ستينيّات هذا القرن مع إصدار رقائق \"ليتراسيت\"&nbsp; البلاستيكية تحوي مقاطع من هذا النص، وعاد لينتشر مرة أخرى مؤخراَ مع ظهور برامج النشر الإلكتروني مثل \"ألدوس بايج مايكر\" والتي حوت أيضاً على نسخ من نص لوريم إيبسوم.</p>', 'ar', 1, 1, 1, 'news', 'placeholder.jpg', 0, '2018-05-15 22:11:08', '2019-03-04 11:01:46', NULL, '2019-03-04 11:01:46', NULL),
