(59, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '2019-02-19 07:13:11', '2019-02-19 07:13:11', NULL, NULL, NULL),
(60, 'الزراعة', '', '', '<p>لا تزال الزراعة الدعامة الأساسية للاقتصاد الفلسطيني. هنا، يمكنك العثور على مجموعة البيانات الخاصة بالزراعة القائمة على الحيوانات والنباتات من تربية النحل إلى أشجار الزيتون ، بالإضافة إلى معلومات حول القوى العاملة الزراعية.</p>', 'ar', 1, 0, 0, 'topics', 'agriculture.svg', 0, '2019-03-04 10:44:22', '2019-04-15 05:16:15', NULL, NULL, 105),
(61, 'Gender', '', '', '<p>If you’re seeking data on women’s status in Palestine, this is the place for you. The datasets included here depict the gender ratio broadly, but also specific issues around women’s empowerment and topics like domestic violence.&nbsp;</p>', 'en', 1, 0, 0, 'topics', 'gender.svg', 0, '2019-03-04 10:47:46', '2019-03-27 23:32:22', NULL, NULL, NULL),
(62, 'Hey', '', '', '', 'en', 1, 0, 0, 'topics', NULL, 0, '2019-03-04 10:48:20', '2019-03-04 10:59:19', NULL, '2019-03-04 10:59:19', NULL),
(63, 'Hello', '', '', '', 'en', 0, 0, 0, 'topics', NULL, 0, '2019-03-04 10:50:17', '2019-03-04 10:50:42', NULL, '2019-03-04 10:50:42', NULL),
(64, 'المساكن', '', '', '<p>لديك أسئلة حول الظروف المعيشية في فلسطين؟ ضمن مجموعة بيانات الإسكان ، يمكنك اختيار وتصور مجموعات البيانات التي تتراوح من كثافة السكن والكمية والأنواع إلى أحجام المنازل وصلتها بالكهرباء.</p>', 'ar', 1, 0, 0, 'topics', 'Asset 3.png', 0, '2019-03-04 11:10:38', '2019-04-10 10:39:35', NULL, NULL, 11),
(65, 'السكان', '', '', '<p>من يعيش في فلسطين وكيف تتغير نسبة السكان مع مرور الوقت؟ يعطي هذا القسم صورة عامة عن إجمالي السكان في الضفة الغربية وقطاع غزة ، مصنفة حسب المنطقة والجنس. ويشمل أيضًا بيانات حجم الأسرة الرئيسية و معدلات الزواج والطلاق والمواليد والوفيات المسجلة سنويًا.</p>', 'ar', 1, 0, 0, 'topics', NULL, 0, '2019-03-04 11:12:15', '2019-06-11 09:10:04', NULL, NULL, 110),
(66, 'التعليم', '', '', '<p>أين يدرس الفلسطينيون ، وكيف يشكل التعليم مستقبلهم؟ يمكنك العثور على إحصاءات حول جميع مراحل التعليم ، بما في ذلك التسجيل حسب نوع المدرسة ومعدلات النجاح في التعليم. يمكنك أيضا العثور على إحصاءات حول الالتحاق بالجامعة وفرص العمل في الجامعات.</p>', 'ar', 1, 0, 0, 'topics', 'education.svg', 0, '2019-03-04 11:12:37', '2019-04-10 10:05:48', NULL, NULL, 16),
(67, 'الزراعة', '', '', '<p>لا تزال الزراعة الدعامة الأساسية للاقتصاد الفلسطيني. هنا، يمكنك العثور على مجموعة البيانات الخاصة بالزراعة القائمة على الحيوانات والنباتات من تربية النحل إلى أشجار الزيتون ، بالإضافة إلى معلومات حول القوى العاملة الزراعية.</p>', 'ar', 1, 0, 0, 'topics', 'agriculture.svg', 0, '2019-03-04 11:13:04', '2019-04-10 10:11:28', NULL, NULL, 60),
(68, 'جندر', '', '', '<p>إذا كنت تبحث عن بيانات حول وضع المرأة في فلسطين ، فهذا هو المكان المناسب لك. تعرض مجموعات البيانات المدرجة هنا نسبة النوع الاجتماعي على نطاق واسع ، وبما في ذلك قضايا محددة حول تمكين المرأة والعنف المنزلي أيضًا.</p>', 'ar', 1, 0, 0, 'topics', 'gender.svg', 0, '2019-03-04 11:13:24', '2019-03-27 23:33:07', NULL, NULL, NULL),
(69, 'Construction', '', '', '<p>What’s being built in Palestine, and how does construction contribute to the economy? Find construction statistics related to the GDP and labor force - and more  and more - here.</p>', 'en', 1, 0, 0, 'topics', 'construction.svg', 0, '2019-03-04 11:13:38', '2019-04-10 10:14:18', NULL, NULL, 70),
(70, 'الإنشاءات', '', '', '<p>ما الذي يتم بناؤه في فلسطين ، وكيف يساهم هذا البناء في الاقتصاد؟ ابحث هنا عن إحصاءات البناء المتعلقة بإجمالي الناتج المحلي والقوى العاملة وأكثر.</p>', 'ar', 1, 0, 0, 'topics', 'construction.svg', 0, '2019-03-04 11:13:48', '2019-04-10 10:15:35', NULL, NULL, 69),
(71, 'Crime and Victimization', '', '', '<p>Find out where crime occurs in Palestine, and what is being done in response, using the Crime and Victimization datasets. In addition to violent and non-violent crime data, you can locate information on road traffic incidents reported and the status of civil court proceedings filed. </p>', 'en', 1, 0, 0, 'topics', 'Crime and Victimization.svg', 0, '2019-03-04 11:14:07', '2019-04-15 05:08:55', NULL, NULL, 72),
(72, 'جريمة وضحية', '', '', '<p>تعرف على مكان حدوث الجريمة في فلسطين ، وما الذي يتم القيام به استجابةً لذلك ، باستخدام مجموعة بيانات الجريمة والضحية. بالإضافة إلى بيانات الجرائم العنيفة وغير العنيفة ، يمكنك العثور على معلومات حول حوادث المرور التي تم الإبلاغ عنها وحالة إجراءات المحكمة المدنية المرفوعة.</p>', 'ar', 1, 0, 0, 'topics', 'Crime and Victimization.svg', 0, '2019-03-04 11:14:27', '2019-04-10 10:26:02', NULL, NULL, 71),
(73, 'Environment', '', '', '<p>Here you can find critical datasets on the natural world in Palestine. View statistics on everything from meteorological conditions, solid waste, and pollution to air emissions. You can also check out how Palestine is preserving the environment by viewing statistics that show government expenditures on environmental issues and localities infrastructure.&nbsp;</p>', 'en', 1, 0, 0, 'topics', 'enviornment.svg', 0, '2019-03-04 11:14:43', '2019-03-27 23:27:35', NULL, NULL, NULL),
(74, 'البيئة', '', '', '<p>هنا يمكنك العثور على مجموعة البيانات الهامة عن الطبيعة في فلسطين. يمكنك عرض إحصاءات عن كل شيء من ظروف الأرصاد الجوية ، والنفايات الصلبة ، والتلوث إلى انبعاثات الهواء. يمكنك أيضًا الاطلاع على كيفية الحفاظ على البيئة في فلسطين من خلال الاطلاع على الإحصائيات التي توضح الإنفاق الحكومي على القضايا البيئية والبنية التحتية للمحليات.</p>', 'ar', 1, 0, 0, 'topics', 'enviornment.svg', 0, '2019-03-04 11:14:54', '2019-03-27 23:28:05', NULL, NULL, NULL),
(75, 'Energy', '', '', '<p>Looking to understand energy use in Palestine? This section presents all the data you 2 need to understand the availability and consumption of energy in the West Bank and Gaza Strip, including information specifically about energy used by households and for transportation.</p>', 'en', 1, 0, 0, 'topics', 'energy.svg', 0, '2019-03-04 11:15:05', '2019-04-15 05:15:57', NULL, NULL, 60),
(76, 'الطاقة', '', '', '<p>هل تريد المزيد من المعرفة عن استخدام الطاقة في فلسطين؟ يعرض هذا القسم جميع البيانات التي تحتاجها لفهم مدى توافر واستهلاك الطاقة في الضفة الغربية وقطاع غزة ، بما في ذلك المعلومات الخاصة بالطاقة التي تستخدمها الأسر والنقل.</p>', 'ar', 1, 0, 0, 'topics', 'energy.svg', 0, '2019-03-04 11:15:12', '2019-03-27 23:29:26', NULL, NULL, NULL),
(77, 'Governance Statistics', '', '', '<p>Governance Statistics encompass a range of datasets related to the rule of law in Palestine. Whether you’re looking for judicial, policing, or prosecutorial updates, if you’re interested in Palestinian governance, you’re sure to find what you’re looking for here.&nbsp;</p>', 'en', 1, 0, 0, 'topics', 'Governance Statistics.svg', 0, '2019-03-04 11:15:25', '2019-03-27 23:33:55', NULL, NULL, NULL),
(78, 'إحصاءات الحكم والديمقراطية', '', '', '<p>تشمل إحصاءات الحوكمة مجموعة من مجموعات البيانات المتعلقة بسيادة القانون في فلسطين. سواء كنت تبحث عن تحديثات قضائية أو شرطية أو النيابة العامة ، إذا كنت مهتمًا بالحكم الفلسطيني ، فمن المؤكد أنك ستجد ما تبحث عنه هنا.</p>', 'ar', 1, 0, 0, 'topics', 'Governance Statistics.svg', 0, '2019-03-04 11:15:42', '2019-03-27 23:34:34', NULL, NULL, NULL),
(79, 'Health', '', '', '<p>Accurate information about the health sector is essential whether you are a patient, physician, or researcher. Here you can find up-to-date statistics on Palestinian hospitals and their conditions, including the number of physicians and beds in each hospital as well as the average duration in days for patients staying at each of these hospitals.</p>', 'en', 1, 0, 0, 'topics', 'health.svg', 0, '2019-03-04 11:15:53', '2019-04-10 10:15:24', NULL, NULL, 80),
(80, 'الصحة', '', '', '<p>المعلومات الدقيقة حول القطاع الصحي ضرورية سواء كنت مريضًا أو طبيباً أو باحثًا. يمكنك العثور هنا على إحصائيات حديثة عن المستشفيات الفلسطينية وظروفها ، بما في ذلك عدد الأطباء والأسرة في كل مستشفى وكذلك معدل عدد الأيام التي يقضيها المريض في كل من هذه المستشفيات.</p>', 'ar', 1, 0, 0, 'topics', 'health.svg', 0, '2019-03-04 11:16:01', '2019-04-10 10:15:25', NULL, NULL, 79),
(81, 'Industry', '', '', '<p>What does the Palestinian market produce? The Industry datasets enable you to visualize statistics about everything from food products to textile manufacturing, and to discover the value of industry across time in Palestinian regions.&nbsp;</p>', 'en', 1, 0, 0, 'topics', 'Industry.svg', 0, '2019-03-04 11:16:13', '2019-03-27 23:38:37', NULL, NULL, NULL),
(82, 'الصناعة', '', '', '<p>ماذا ينتج السوق الفلسطيني؟ تُمكّنك مجموعات بيانات الصناعة من تصور إحصائيات حول كل شيء بدءًا من تصنيع المنتجات الغذائية إلى المنسوجات واكتشاف قيمة الصناعة عبر الزمن في المناطق الفلسطينية.</p>', 'ar', 1, 0, 0, 'topics', 'Industry.svg', 0, '2019-03-04 11:16:24', '2019-03-27 23:39:07', NULL, NULL, NULL),
(83, 'International Investment', '', '', '<p>To get a full picture of the Palestinian economy, you’ll need to understand interantional investment across sectors. Here you can find all the data you’re looking for about foreign direct investment in Palestine and portfolio investments abroad. You can filter this data according to the government, banking, and household sectors.&nbsp;</p>', 'en', 1, 0, 0, 'topics', 'International Investment.svg', 0, '2019-03-04 11:16:37', '2019-03-27 23:57:34', NULL, NULL, NULL),
(84, 'الاستثمار الدولي', '', '', '<p>للحصول على صورة كاملة للاقتصاد الفلسطيني ، ستحتاج إلى فهم الاستثمار عبر القطاعات. هنا يمكنك العثور على جميع البيانات التي تبحث عنها حول الاستثمار الأجنبي المباشر في فلسطين واستثمارات المحافظ في الخارج. يمكنك تصفية هذه البيانات وفقًا للقطاعات الحكومية والمصرفية والأسرية.</p>', 'ar', 1, 0, 0, 'topics', 'International Investment.svg', 0, '2019-03-04 11:16:46', '2019-04-23 07:05:56', NULL, NULL, 115),
(85, 'Israeli Violations', '', '', '<p>Israeli colonial practices continue to threaten the establishment of a viable Palestinian state in the West Bank and Gaza Strip. To understand the demographic dimensions of Israeli violations, here you can find information on martyrs and those injured or detained by Israeli forces, as well as damage to buildings.</p>', 'en', 1, 0, 0, 'topics', 'israeli violations.svg', 0, '2019-03-04 11:16:59', '2019-03-28 00:03:21', NULL, NULL, NULL),
(86, 'الانتهاكات الاسرائيلية', '', '', '<p>لا تزال الممارسات الاستعمارية الإسرائيلية تهدد قيام دولة فلسطينية قابلة للحياة في الضفة الغربية وقطاع غزة. لفهم الأبعاد الديموغرافية للانتهاكات الإسرائيلية ، يمكنك العثور هنا على معلومات عن الشهداء والمصابين أو المحتجزين على أيدي القوات الإسرائيلية ، فضلاً عن الأضرار التي لحقت بالمباني.</p>', 'ar', 1, 0, 0, 'topics', 'israeli violations.svg', 0, '2019-03-04 11:17:08', '2019-03-28 00:03:44', NULL, NULL, NULL),
(87, 'Labor Force', '', '', '<p>The Palestinian labor force is a dynamic and every-changing body. These datasets are a valuable resource to understand Palestinian employment in the West Bank and Gaza, disaggregated by sex and level of education, as well as the sectors and location of employers.&nbsp;</p>', 'en', 1, 0, 0, 'topics', 'Labor Force.svg', 0, '2019-03-04 11:17:24', '2019-03-28 00:04:22', NULL, NULL, NULL),
(88, 'قوى عاملة', '', '', '<p>قوة العمل الفلسطينية هي هيئة ديناميكية ومتغيرة. تعد هذه المجموعة من البيانات مورداً قيماً لفهم العمالة الفلسطينية في الضفة الغربية وقطاع غزة ، مصنفة حسب الجنس ومستوى التعليم ، وكذلك قطاعات ومواقع أرباب العمل.</p>', 'ar', 1, 0, 0, 'topics', 'Labor Force.svg', 0, '2019-03-04 11:17:33', '2019-03-28 00:04:53', NULL, NULL, NULL);
INSERT INTO `posts` (`id`, `title`, `subline`, `summary`, `description`, `language`, `public`, `featured`, `comments`, `type`, `image`, `created_by`, `created_at`, `updated_at`, `deleted_by`, `deleted_at`, `related_id`) VALUES
(89, 'Living Conditions', '', '', '<p>What does the cost of living amount to in Palestine? Here you can find relevant data on expenditures and consumption on food and non-food stuffs by Palestinians. Poverty rates are also presented and disaggregated by location and household type in urban, rural, and refugee camp settings.</p>', 'en', 1, 0, 0, 'topics', 'Living Conditions.svg', 0, '2019-03-04 11:17:46', '2019-03-28 00:05:31', NULL, NULL, NULL),
(90, 'معايير المعيشة', '', '', '<p>ما تكلفة المعيشة في فلسطين؟ هنا يمكنك العثور على البيانات ذات الصلة حول النفقات والاستهلاك على المواد الغذائية وغير الغذائية من قبل الفلسطينيين. كما يتم عرض معدلات الفقر وتصنيفها حسب الموقع ونوع الأسرة في المناطق الحضرية والريفية ومخيمات اللاجئين.</p>', 'ar', 1, 0, 0, 'topics', 'Living Conditions.svg', 0, '2019-03-04 11:17:55', '2019-03-28 00:06:02', NULL, NULL, NULL),
(91, 'National Accounts', '', '', '<p>If you need an overview of the Palestinian economy, these are the datasets for you. This section depicts an array of macroeconomic indicators, such as the Gross Domestic Product, Gross National Income, Net Exports, and Disposable Income. When calculated per capita, these indicators show the contours of the Palestinian economy.&nbsp;</p>', 'en', 1, 0, 0, 'topics', 'National Accounts.svg', 0, '2019-03-04 11:18:06', '2019-03-28 00:07:37', NULL, NULL, NULL),
(92, 'الحسابات القومية', '', '', '<p>إذا كنت بحاجة إلى نظرة عامة عن الاقتصاد الفلسطيني ، فهذه هي مجموعة البيانات لك. يوضح هذا القسم مجموعة من مؤشرات الاقتصاد الكلي ، مثل إجمالي الناتج المحلي الفلسطيني ، إجمالي الدخل القومي ، صافي الصادرات ، والدخل المتاح. عند حسابها للفرد الواحد ، تُظهر هذه المؤشرات حدود الاقتصاد الفلسطيني.</p>', 'ar', 1, 0, 0, 'topics', 'National Accounts.svg', 0, '2019-03-04 11:18:13', '2019-03-28 00:07:10', NULL, NULL, NULL),
(93, 'Prices and Price Indices', '', '', '<p>Price statistics shape our daily realities. Using these datasets, you can understand changes in price indices as well as the inflation rate, its impact on individuals’ income, and patterns of household consumption.</p>', 'en', 1, 0, 0, 'topics', 'Prices and Price Indices.svg', 0, '2019-03-04 11:18:27', '2019-03-28 00:08:26', NULL, NULL, NULL),
(94, 'الأسعار والارقام القياسية', '', '', '<p>إحصاءات الأسعار تشكل حقائقنا اليومية. باستخدام مجموعة البيانات هذه ، يمكنك فهم التغييرات في مؤشرات الأسعار و معدل التضخم وتأثيره على دخل الأفراد وأنماط الاستهلاك المنزلي.&nbsp;</p>', 'ar', 1, 0, 0, 'topics', 'Prices and Price Indices.svg', 0, '2019-03-04 11:18:40', '2019-03-28 00:08:59', NULL, NULL, NULL),
(95, 'Science and Technology', '', '', '<p>What does connectivity look like in Palestine? These datasets cover access and use of ICT by households, individuals, and businesses, as well as data on research, development, and special data dissemination standards (SDDS).&nbsp;</p>', 'en', 1, 0, 0, 'topics', 'Science and Technology.svg', 0, '2019-03-04 11:19:00', '2019-03-28 00:09:41', NULL, NULL, NULL),
(96, 'العلم والتكنولوجيا', '', '', '<p>كيف وضع الاتصال في فلسطين؟ هذا الموضوع يغطي معلومات حول استخدام تكنولوجيا المعلومات والاتصالات من قبل الأسر والأفراد والشركات. يحتوي أيضًا على بيانات حول البحث والتطوير ، بالإضافة إلى معيار نشر البيانات الخاص (SDDS)</p>', 'ar', 1, 0, 0, 'topics', 'Science and Technology.svg', 0, '2019-03-04 11:19:16', '2019-03-28 00:10:06', NULL, NULL, NULL),
(97, 'Tourism', '', '', '<p>Who visits Palestine, and what sites do they check out? Here you can understand changes in the tourism sector over time, as well as its importance to the GDP by viewing datasets on hotels and accommodations.&nbsp;</p>', 'en', 1, 0, 0, 'topics', 'Tourism.svg', 0, '2019-03-04 11:19:28', '2019-03-28 00:16:33', NULL, NULL, NULL),
(98, 'السياحة', '', '', '<p>من يزور فلسطين ، وما المواقع التي يستطلعون عليها؟ هنا يمكنك تفحص التغييرات مع الوقت في قطاع السياحة ، وفهم أهميتها بالنسبة للناتج المحلي الإجمالي من خلال عرض مجموعات البيانات على الفنادق والإقامة.</p>', 'ar', 1, 0, 0, 'topics', 'Tourism.svg', 0, '2019-03-04 11:19:39', '2019-03-28 00:16:53', NULL, NULL, NULL),
(99, 'Transport, storage & communication', '', '', '<p>If you’re wondering how Palestinians travel, look no further. In this section you can find datasets about road transport, road accidents, injuries, as well as statistics on driving schools and instructors.&nbsp;</p>', 'en', 1, 0, 0, 'topics', 'Transport, storage & communication.svg', 0, '2019-03-04 11:19:50', '2019-03-28 00:17:30', NULL, NULL, NULL),
(100, 'النقل والتخزين والاتصالات', '', '', '<p>إذا كنت تتساءل عن كيفية سفر الفلسطينيين ، فلا تنظر إلى أبعد من ذلك. في هذا القسم ، يمكنك العثور على مجموعات بيانات حول النقل البري والحوادث المرورية والإصابات بالإضافة إلى إحصائيات حول مدارس القيادة والمدربين.</p>', 'ar', 1, 0, 0, 'topics', 'Transport, storage & communication.svg', 0, '2019-03-04 11:20:02', '2019-03-28 00:17:58', NULL, NULL, NULL),
(101, 'Trade', '', '', '<p>To understand the Palestinian economy in full, it’s important to know where Palestinians go to work. This section contains datasets on trade across the Palestinian public, private and NGO sectors, focusing on employment levels by location.</p>', 'en', 1, 0, 0, 'topics', 'Trade.svg', 0, '2019-03-04 11:20:14', '2019-03-28 00:18:32', NULL, NULL, NULL),
(102, 'التجارة', '', '', '<p>لفهم الاقتصاد الفلسطيني بالكامل ، من المهم معرفة أين يذهب الفلسطينيون إلى العمل. يحتوي هذا القسم على مجموعات بيانات حول التجارة عبر القطاعين العام والخاص والمنظمات غير الحكومية الفلسطينية ، مع التركيز على مستويات التوظيف حسب الموقع.</p>', 'ar', 1, 0, 0, 'topics', 'Trade.svg', 0, '2019-03-04 11:20:21', '2019-03-28 00:19:26', NULL, NULL, NULL),
(103, 'Water & Wastewater', '', '', '<p>Water is a precious natural resource in Palestine. This section will help you understand water availability and consumption, as well as wastewater disposal methods and treatment plants</p>', 'en', 1, 0, 0, 'topics', 'Water & Wastewater.svg', 0, '2019-03-04 11:20:32', '2019-03-28 00:20:15', NULL, NULL, NULL),
(104, 'المياه والمياه العادمة', '', '', '<p>قسم المياه يتضمن بيانات عن المياه المتاحة في فلسطين وكذلك مصادر المياه وإحصاءات الاستهلاك. سوف يوفر جهاز الإحصاء معلومات حول طرق التخلص من المياه العادمة ومحطات المعالجة أيضا.</p>', 'ar', 1, 0, 0, 'topics', 'Water & Wastewater.svg', 0, '2019-03-04 11:20:46', '2019-04-15 05:57:12', NULL, NULL, 105),
(105, 'Balance of Payments', 'hahahdddddda', '', '<p>Hi Here you can find data from PCBS published jointly with the Palestine Monetary Authority (PMA) on the Balance of Payments. These figures includes the current, income, transfers, and capital accounts, explaining gains and deficits in the Palestinian economy.  </p>', 'en', 1, 0, 0, 'topics', 'Balance of Payments.svg', 0, '2019-03-04 11:20:56', '2019-04-23 07:21:59', NULL, NULL, 106),
(106, 'ميزان المدفوعات', '', '', '<p>يمكنك العثور هنا على بيانات محدّثة من الجهاز المركزي للإحصاء تُنشر بالاشتراك مع سلطة النقد الفلسطينية (PMA) حول ميزان المدفوعات.هذه الأرقام تشمل الحسابات الجارية ، الدخل ، التحويلات ، وحسابات رأس المال التي توضح المكاسب والعجز في الاقتصاد الفلسطيني.</p>', 'ar', 1, 0, 0, 'topics', 'Balance of Payments.svg', 0, '2019-03-04 11:21:08', '2019-04-10 10:13:21', NULL, NULL, 105),
