INSERT INTO `widgets` (`id`, `title`, `description`, `language`, `sort`, `created_by`, `created_at`, `updated_at`, `deleted_by`, `deleted_at`) VALUES
(1, 'About Indicators', 'The Palestinian Central Bureau of Statistics aims to develop and enhance the Palestinian official statistical system based on legal grounds that organize the process of data collection and utilization for statistical purposes.', 'en', 1, 0, '2018-04-07 20:29:00', '2018-05-14 12:12:44', NULL, NULL),
(2, 'Share', '<div id=\"share\"></div>', 'en', 0, 0, '2018-04-07 20:30:45', '2018-04-07 20:30:45', NULL, NULL),
(3, 'Tags', '<div class=\"w-tags\">\r\n    <a href=\"#\">Census 2017</a>\r\n <a href=\"/library?q=gender\">Gender</a>\r\n    <a href=\"/library?q=indicators\">Indicators</a>\r\n    <a href=\"#\">Wholesale</a>\r\n    <a href=\"#\">Products</a>\r\n    <a href=\"#\">Demographics</a>\r\n    <a href=\"#\">Exports</a>\r\n    <a href=\"#\">Imports</a>\r\n</div>', 'en', 3, 0, '2018-04-07 20:32:32', '2018-04-08 08:53:45', NULL, NULL),
(4, 'حول الجهاز', '<p>يعتبر الجهاز المركزي للإحصاء الفلسطيني المرجع الوحيد للرقم الإحصائي الرسمي الفلسطيني، ومهمتنا الأساسية توفير الإحصاءات في مجالات كثيرة مثل السكان والتعليم والصحة والبطالة والفقر والاقتصاد والبيئة والمياه وغيرها؛ لتلبية احتياجات المستخدمين، مؤسسات كانوا أم أفرادا بمختلف الاعمار، وتماشيا مع المعايير العالمية والممارسات الجيدة والتوجهات لنشر البيانات بطرق تفاعلية واستخدام تقنيات متطورة لنشر البيانات باستخدام التصورات المرئية لتلبية احتياجات المستخدمين وسهولة الوصول واستخدام البيانات، يسعدنا ان نعلن عن اطلاق الموقع الالكتروني \"المؤشرات الاحصائية\" والذي سيوفر بيانات احصائية رسمية وحديثة وشاملة حول مواضيع مختلفة مع التركيز على مؤشرات التعداد العام للسكان والمساكن والمنشآت  2017 حيث ان موقع مؤشرات يتيح للمستخدم عرض البيانات باستخدام التصورات المرئية الـــData Visualization وإمكانية البحث والفلترة الديناميكية للمؤشرات حسب الموضوع والموضوع الفرعي، المحافظة، السنة، الفئات العمرية وغيرها، وكذلك اتاحة خاصية عمل تنزيل أو تصدير للبيانات بصيغ مختلفة. وسنقوم باغناء موقع مؤشرات بشكل دوري لضمان حداثة البيانات ووجود بيانات ومؤشرات ضمن سلاسل زمنية لإتاحة خاصية المقارنة من قبل المستخدم.    </p>', 'ar', 1, 0, '2018-04-24 21:54:06', '2019-03-04 09:41:27', NULL, NULL),
